window.bookSummaryJSON = "<p><b>Can an Earthman running low on ammo wrangle a world full of magic and monsters?</b></p> <p>As a mountain man, cowboy, and cavalry scout, Jedediah Braddock handled every challenge on America’s Western frontier. Then he’s transported to Tardoon, a magical world full of deadly predators, gorgeous monster girls, and brutal centaurs.</p> <p>Most men would have died on arrival, but Braddock has enough love and courage to forge a new destiny in this mighty land. Filled with tough optimism and pioneering spirit, he vows to build the desperate monster girls a sanctuary in the wilderness.</p> <p>There is much to do.</p> <p>Timber to cut. Cabins to build. Game to hunt. Land to plow and plant.</p> <p>Sprites to seed. Children to raise. And a whole bunch of enemies to kill.</p> <p><b>Warning: This series contains graphic violence, undefined relationships/harem, and a strong male protagonist with the rough-and-ready attitude of an American frontiersman. Listen at your own risk.</b></p>"; 
